INSERT INTO `land_article` (`id`, `category_id`, `project_id`, `name`, `name_eng`, `slug`, `slug_eng`, `intro`, `intro_eng`, `description`, `description_eng`, `image_default`, `gallery`, `view_count`, `type`, `status`, `ordering`, `module`, `created_by`, `created_ip`, `updated_by`, `user_agent`, `created_at`, `updated_at`) VALUES
(1, NULL, NULL, 'Giới thiệu', 'About us', 'gioi-thieu', NULL, NULL, NULL, '<p>Hello&nbsp;<a title="568fdd208a35c_1452268832.jpg" href="#"> <img src="http://cdn.jinn.vn/asset/frontend/upload/stories/2016/01/s568fdd208a35c_1452268832.jpg" alt="568fdd208a35c_1452268832.jpg" /> </a></p>', '<p>Contact Us&nbsp;<a title="568fdd208a35c_1452268832.jpg" href="#"> <img src="http://cdn.jinn.vn/asset/frontend/upload/stories/2016/01/s568fdd208a35c_1452268832.jpg" alt="568fdd208a35c_1452268832.jpg" /> </a></p>', 'http://cdn.jinn.vn/asset/frontend/upload/stories/2016/01/s568fdd208a35c_1452268832.jpg', NULL, 0, 1, 1, 0, 2, 1, '14.161.14.105', 1, 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10.11; rv:43.0) Gecko/20100101 Firefox/43.0', '2015-12-28 07:21:22', '2016-03-28 08:44:53'),
(2, 2, NULL, '10', NULL, '10', 'n-a', 'Dậu', NULL, '<p>- Thi&ecirc;n can của con l&agrave; <strong>Canh</strong>, bố l&agrave; <strong>Canh</strong>, mẹ l&agrave; <strong>Canh</strong><br />- Thi&ecirc;n can của bố kh&ocirc;ng sinh, kh&ocirc;ng khắc với thi&ecirc;n can của con, chấp nhận được <br />- Thi&ecirc;n can của mẹ kh&ocirc;ng sinh, kh&ocirc;ng khắc với thi&ecirc;n can của con, chấp nhận được <br />- Đ&aacute;nh gi&aacute;: 1.0 /2 điểm</p>', NULL, '', '[]', 0, 10, 1, 0, 3, 1, '183.80.177.144', 1, 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.116 Safari/537.36', '2016-03-10 16:46:26', '2016-03-10 16:46:26'),
(3, NULL, 2, 'Chính sách bán hàng VINHOMES GARDENIA đến hết tháng 3/2016', '', 'chinh-sach-ban-hang-vinhomes-gardenia-den-het-thang-3-2016', 'n-a', NULL, NULL, '<p>Từ ng&agrave;y 15/02 đến hết ng&agrave;y 31/03 kh&aacute;ch h&agrave;ng đặt cọc mua căn hộ chung cư tại dự &aacute;n&nbsp;Vinhomes Gardenia&nbsp;sẽ được tặng qu&agrave;&nbsp;tương đương với 1 c&acirc;y v&agrave;ng SJC.<br />+ G&oacute;i Voucher Vinschool: KH mua căn hộ được Voucher VinSchool trị gi&aacute; 50 triệu đồng. Voucher được gửi tới KH khi nhận b&agrave;n giao căn hộ</p>\r\n<p>+ G&oacute;i Miễn ph&iacute; rau VinEco 03 th&aacute;ng: KH mua căn hộ được tặng 08 g&oacute;i rau/th&aacute;ng (mỗi g&oacute;i 2-3kg) trong thời hạn 03 th&aacute;ng kể từ ng&agrave;y gửi rau (th&aacute;ng 05/2016) với điều kiện KH thanh to&aacute;n 30% gi&aacute; b&aacute;n căn hộ.</p>\r\n<p>+ Được chiết khấu tới 7.5% gi&aacute; trị căn hộ cho KH thanh to&aacute;n sớm</p>\r\n<p>+ Ưu đ&atilde;i vay tới 70% gi&aacute; trị căn hộ từ ng&acirc;n h&agrave;ng đối t&aacute;c</p>\r\n<p>(Qu&agrave; tặng n&agrave;y sẽ được trừ thẳng v&agrave;o gi&aacute; b&aacute;n căn hộ khi kh&aacute;ch k&yacute; thỏa</p>', '', 'http://cdnjinn.codex4u.com/asset/frontend/upload/stories/2016/07/578cc29764d18_1468842647.png', NULL, 0, 1, 1, 0, 4, 1, '171.248.55.13', 1, 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.116 Safari/537.36', '2016-04-09 16:15:18', '2016-08-09 16:18:52'),
(4, 2, NULL, '04', NULL, '04', 'n-a', 'Mẹo', NULL, '<header>\r\n<h1>Tử vi 2016 tuổi Th&igrave;n sơ lược</h1>\r\n</header>\r\n<div class="blog-post-body">\r\n<p><em>Đ&acirc;y l&agrave; phần luận đo&aacute;n sơ lược </em>tử vi 2016<em> cho người tuổi Th&igrave;n. Bao gồm: Gi&aacute;p Th&igrave;n, B&iacute;nh Th&igrave;n, Mậu Th&igrave;n, Canh Th&igrave;n, Nh&acirc;m Th&igrave;n.&nbsp;</em><em>Bạn c&oacute; xem th&ecirc;m chi tiết&nbsp;tử vi 2016 tuổi Th&igrave;n&nbsp;cho từng tuổi hoa gi&aacute;p.</em></p>\r\n<h2>I. Tử vi 2016 về t&agrave;i lộc, sự nghiệp v&agrave; t&igrave;nh y&ecirc;u h&ocirc;n nh&acirc;n của người tuổi Th&igrave;n</h2>\r\n<h3>1. T&agrave;i lộc của người tuổi Th&igrave;n trong năm B&iacute;nh Th&acirc;n 2016</h3>\r\n<p>30% t&agrave;i lộc của con người l&agrave; do trời ph&uacute;. 70% ph&aacute;t đạt gi&agrave;u c&oacute; l&agrave; dựa v&agrave;o bản th&acirc;n. Sinh mệnh sinh ra rồi lại chết đi, cuộc đời vận chuyển m&atilde;i kh&ocirc;ng ngừng, tiền bạc ph&uacute; qu&yacute; giống nhu nước chảy. Theo ph&acirc;n t&iacute;ch vận ho&aacute; của hơn 120 sao trong l&aacute; số tử vi, c&ugrave;ng với sự vận h&agrave;nh kết hợp lu&acirc;n phi&ecirc;n nhau của 10 thi&ecirc;n can v&agrave; 12 địa chi, thể hiện v&ocirc; số cơ duy&ecirc;n trong từng năm. Tổng kết quy luật vận h&agrave;nh n&agrave;y sẽ khiến ch&uacute;ng ta t&igrave;m ra được xu thế v&agrave; huớng đi của t&agrave;i lộc, m&agrave; đ&uacute;c kết thực tiễn 12 con gi&aacute;p ứng với h&agrave;ng triệu người sẽ gi&uacute;p ch&uacute;ng ta "t&igrave;m l&agrave;nh tr&aacute;nh dữ" tr&ecirc;n con đuờng t&igrave;m kiếm sự ph&aacute;t t&agrave;i.</p>\r\n<p>Quan niệm về quản l&yacute; t&agrave;i ch&iacute;nh của người tuổi Th&igrave;n rất r&otilde; r&agrave;ng. Nếu c&oacute; thể h&agrave;i ho&agrave; giữa hiện thực v&agrave; l&iacute; tưởng, coi việc kiếm tiền l&agrave; "lẽ sống" th&igrave; họ c&oacute; thể trở th&agrave;nh "si&ecirc;u tỉ ph&uacute;".</p>\r\n<p>Tuy nhi&ecirc;n, nh&igrave;n v&agrave;o c&aacute; t&iacute;nh của người tuổi Th&igrave;n, nếu thu v&agrave;o nhiều th&igrave; chi ra cũng kh&aacute; lớn. Bởi vậy, n&ecirc;u họ muổn t&iacute;ch kiệm c&oacute; kế hoạch th&igrave; c&oacute; thể theo đuổi một số "nghề phụ" như đầu tư v&agrave;o cổ phiếu hay bu&ocirc;n b&aacute;n bất động sản, đ&oacute; l&agrave; c&aacute;ch tốt để "tăng v&agrave; giữ g&igrave;n t&agrave;i sản".</p>\r\n<p>Những người tuổi Th&igrave;n đa phần "được trời cho lộc", t&agrave;i lộc th&ocirc;ng suốt, &iacute;t khi gặp nguy kh&ocirc;n, song tốt nhất vẫn n&ecirc;n thận trọng với tiền đồ tương lai.</p>\r\n<h4>T&agrave;i lộc trong năm 2016 B&iacute;nh Th&acirc;n của tuổi Th&igrave;n</h4>\r\n<p>Tử vi 2016 luận rằng người tuổi Th&igrave;n kh&oacute; "nắm chắc" trong năm B&iacute;nh Th&acirc;n n&agrave;y, kh&ocirc;ng n&ecirc;n tham lam. Điều đặc biệt cần dừng lại đ&uacute;ng l&uacute;c, nếu kh&ocirc;ng rất c&oacute; thể l&acirc;m v&agrave;o ho&agrave;n cảnh t&agrave;i ch&iacute;nh tồi tệ. Th&aacute;ng xấu nhất cho t&agrave;i lộc năm Th&acirc;n l&agrave; th&aacute;ng 1, 2, 5 v&agrave; 9 &acirc;m lịch, cần đặc biệt ch&uacute; &yacute; tới quản l&yacute; thu chi, cố gắng hạn chế v&agrave;o c&aacute;c hoạt động đầu tư mạo hiểm. C&ograve;n c&aacute;c th&aacute;ng tốt l&agrave; th&aacute;ng 3, 4, 7, 8 v&agrave; 12 &acirc;m lịch, nhờ c&oacute; "T&agrave;i Tinh" chiếu ở tr&ecirc;n cao, n&ecirc;n nắm chắc thời cơ, t&iacute;ch cực h&agrave;nh động mau lẹ.</p>\r\n<p><img src="http://tuvisomenh.com/Media/Default/BlogPost/tu-vi-2016-2.jpg" alt="tử vi 2016" width="550" height="320" /></p>\r\n<h3>2. Sự nghiệp năm 2016 của người tuổi T&yacute;</h3>\r\n<p>Những người chuy&ecirc;n nghi&ecirc;n cứu về thuật số tử vi cho rằng: nắm vững được quy luật qua từng năm của 12 con gi&aacute;p, biết lựa theo sự thay đổi của thời cuộc, sắp xếp sự nghiệp, c&ocirc;ng việc v&agrave; cuộc sống một c&aacute;ch hợp l&yacute; sẽ gi&uacute;p cuộc đời mỗi người c&oacute; được sự hanh th&ocirc;ng, hiển đạt.</p>\r\n<p>Mặc d&ugrave; sự nghiệp của tuổi Th&igrave;n 2016 sẽ phải đứng trước rất nhiều sự cạnh tranh nhưng nếu nắm được thế chủ động v&agrave; t&iacute;ch cực tiến l&ecirc;n th&igrave; họ vẫn c&oacute; thể c&oacute; nhiều tiến bộ với những th&agrave;nh c&ocirc;ng đ&aacute;ng nể.</p>\r\n<p>Trong khi giải quyết c&aacute;c m&acirc;u thuẫn ở cả b&ecirc;n trong v&agrave; b&ecirc;n ngo&agrave;i, họ cần tr&aacute;nh c&oacute; th&aacute;i độ tự cao, tự đại để cố gắng tranh thủ sự ủng hộ của mọi người xung quanh, gi&uacute;p cho c&ocirc;ng việc được tiến triển nhanh ch&oacute;ng. C&aacute;c th&aacute;ng m&agrave; sự nghiệp của họ sẽ c&oacute; bước ph&aacute;t triển vượt trội trong năm n&agrave;y l&agrave; th&aacute;ng 1, th&aacute;ng 2, th&aacute;ng 7, th&aacute;ng 8, th&aacute;ng 9 v&agrave; th&aacute;ng 12 &acirc;m lịch, cần cố gắng nắm bắt thời cơ.</p>\r\n<p>Một điều nữa họ cũng cần hết sức ghi nhớ l&agrave; phải quyết đo&aacute;n trong mọi trường hợp, tr&aacute;nh để lỡ mất cơ hội v&agrave;o tay người kh&aacute;c.</p>\r\n<p><em>Qua tử vi năm 2016 thấy rằng những th&aacute;ng &acirc;m lịch sau đ&acirc;y, người tuổi Th&igrave;n về sự nghiệp v&agrave; c&ocirc;ng việc c&oacute; một số n&eacute;t ch&iacute;nh như sau:</em></p>\r\n<p><strong>Th&aacute;ng 1:</strong> Người tuổi Th&igrave;n được sao tốt chiếu mệnh n&ecirc;n sự nghiệp sẽ c&oacute; bước ph&aacute;t triển thuận lợi. Họ cũng n&ecirc;n thử nghiệm m&igrave;nh trong nhiều lĩnh vực kh&aacute;c nhau. Tuy nhi&ecirc;n, họ tuyệt đối kh&ocirc;ng n&ecirc;n vội v&agrave;ng, hấp tấp khi quyết định hướng đi cho tiền đồ của m&igrave;nh m&agrave; cần lập một kế hoạch chi tiết, cụ thể đế t&igrave;m ra con đường đi ph&ugrave; hợp nhất. Trong th&aacute;ng n&agrave;y, những người tuổi Th&igrave;n đang l&agrave; diễn vi&ecirc;n điện ảnh hoặc người mẫu sẽ c&oacute; những biểu hiện đột ph&aacute;, nổi trội trong c&ocirc;ng việc.</p>\r\n<p><strong>Th&aacute;ng 2:</strong> Sự nghiệp của người tuổi Th&igrave;n tương đối thuận lợi v&agrave;o đầu th&aacute;ng nhưng về cuối th&aacute;ng lại gặp kh&aacute; nhiều trắc trỏ, kh&oacute; khăn. Nếu kh&ocirc;ng c&oacute; quyết t&acirc;m tiến l&ecirc;n th&igrave; rất c&oacute; thể họ sẽ thất bại v&agrave;o đ&uacute;ng thời điểm n&agrave;y.</p>\r\n<p><strong>Th&aacute;ng 3:</strong> Sự nghiệp của người tuổi Th&igrave;n cũng giống như người đang đi thuyền tr&ecirc;n dồng nưốc ngược vậy: dễ thụt l&ugrave;i m&agrave; kh&oacute; tiến l&ecirc;n. Nếu qu&aacute; n&ocirc;n n&oacute;ng, lo lắng cho sự nghiệp của m&igrave;nh, rất c&oacute; thể họ sẽ ở trong t&igrave;nh cảnh "giục tốc bất đạt". Mặt kh&aacute;c, với t&iacute;nh c&aacute;ch hơi bảo thủ n&ecirc;n việc tiến l&ecirc;n một c&aacute;ch dũng cảm nhưng m&ugrave; qu&aacute;ng của họ ở một mức độ n&agrave;o đ&oacute; cũng sẽ tạo n&ecirc;n những kết quả kh&ocirc;ng mấy tốt đẹp. Nhưng nếu qu&aacute; cẩn trọng v&agrave; lo lắng th&igrave; họ cũng kh&ocirc;ng thể ph&aacute;t huy được hết những t&agrave;i năng của m&igrave;nh v&agrave; rất c&oacute; thể sẽ để lỡ mất những cơ hội tốt.</p>\r\n<p><strong>Th&aacute;ng 5:</strong> Tất cả những kh&uacute;c mắc trong c&ocirc;ng việc của người tuổi Th&igrave;n đều sẽ lần lượt được th&aacute;o gỡ. Sự nghiệp của họ sẽ c&oacute; bước ph&aacute;t triển lổn, c&oacute; thể n&oacute;i l&agrave; "một bước đến trời". Nhiệm vụ quan trọng nhất của họ trong giai đoạn n&agrave;y l&agrave; biết c&aacute;ch nắm lấy cơ hội, ph&aacute;t hiện ra suy nghĩ của người kh&aacute;c để nắm được thế chủ động. Một điều nữa họ cần hết sức lưu &yacute; l&agrave; d&ugrave; l&agrave;m bất cứ việc g&igrave; cũng đều phải biết điều chỉnh t&acirc;m trạng của m&igrave;nh, kh&ocirc;ng n&ecirc;n tiếc nuối m&atilde;i những g&igrave; đ&atilde; qua bởi chỉ c&oacute; như vậy th&igrave; c&ocirc;ng việc, sự nghiệp của họ mới thật sự ph&aacute;t triển được.</p>\r\n<p><strong>Th&aacute;ng 9:</strong> Người tuổi Th&igrave;n được sao tốt chiếu mệnh n&ecirc;n c&ocirc;ng việc, sự nghiệp đều v&ocirc; c&ugrave;ng thuận lợi. Nhiệm vụ quan trọng nhất của họ l&agrave; nh&igrave;n nh&acirc;n r&otilde; t&igrave;nh h&igrave;nh để x&aacute;c định đ&uacute;ng mục ti&ecirc;u, kh&ocirc;ng n&ecirc;n t&ugrave;y tiện bỏ qua bất kỳ một chi tiết nhỏ n&agrave;o cả. Nếu may mắn, họ c&oacute; thể biến nguy th&agrave;nh an nhưng nếu để mất cơ hội th&igrave; lại giống như rơi v&agrave;o một vũng lầy v&agrave; nếu chỉ dựa v&agrave;o sức m&igrave;nh th&igrave; sẽ kh&oacute; m&agrave; tho&aacute;t ra được.</p>\r\n<p><strong>Th&aacute;ng 12:</strong> Sự nghiệp của người tuổi Th&igrave;n sẽ c&oacute; bước ph&aacute;t triển vượt trội. Tất cả những cản trở trước đ&acirc;y đều bị họ ph&aacute; vỡ v&agrave; vượt qua để t&igrave;m thấy những cơ hội mới. Nhiệm vụ quan trọng nhất của họ trong th&aacute;ng n&agrave;y l&agrave; phải t&igrave;m ra được nhược điểm của m&igrave;nh v&agrave; cho thuồc đ&uacute;ng bệnh, đồng thời l&ecirc;n kế hoạch cụ thể, chi tiết cho c&ocirc;ng việc của cả một năm sau. &nbsp;</p>\r\n<h3>3. T&igrave;nh y&ecirc;u h&ocirc;n nh&acirc;n của người tuổi Th&igrave;n</h3>\r\n<p>T&igrave;nh y&ecirc;u l&agrave; một phần kh&ocirc;ng thể thiếu trong cuộc sống hạnh ph&uacute;c của mỗi con ngư&ograve;i. Theo đuổi một t&igrave;nh y&ecirc;u đẹp cũng l&agrave; nơi &yacute; nghĩa của cuộc sống tồn tại. T&ugrave; xưa đến nay, ai cũng mong muốn c&oacute; được một t&igrave;nh y&ecirc;u đẹp v&agrave; sẽ được sống suốt đời trong mật ngọt của t&igrave;nh y&ecirc;u đ&oacute;. &ldquo;Những người c&oacute; số đ&agrave;o hoa th&igrave; thường gặp được nhiều điều may mắn". Những người cầm tinh kh&aacute;c nhau th&igrave; số phận, t&igrave;nh duy&ecirc;n của họ cũng sẽ kh&aacute;c nhau. Nếu biết trước được số phận nhu thế n&agrave;o th&igrave; ch&uacute;ng ta ho&agrave;n to&agrave;n c&oacute; thể nắm bắt được cuộc đời, biến hung th&agrave;nh c&aacute;t, biến họa th&agrave;nh ph&uacute;c.</p>\r\n<p>Sức hấp dẫn của người tuổi Th&igrave;n nằm ở t&iacute;nh c&aacute;ch rộng r&atilde;i, lạc quan. Nếu việc g&igrave; đ&oacute; kh&ocirc;ng được như &yacute;, người tuổi Th&igrave;n cũng &iacute;t khi thể hiện sự thất vọng, ch&aacute;n chường tr&ecirc;n khu&ocirc;n mặt. Sự l&atilde;ng mạn, ng&acirc;y thơ v&agrave; t&iacute;nh c&aacute;ch cỏi mỏ, vui vẻ c&agrave;ng l&agrave;m cho họ trỏ n&ecirc;n hấp dẫn hơn trong m&aacute;t người kh&aacute;c giới. V&igrave; vậy, ngay cả khi c&oacute; va chạm với những người th&igrave; họ cũng dễ d&agrave;ng gi&agrave;nh được cảm t&igrave;nh của đối phương.</p>\r\n<p>Nam giới tuổi Th&igrave;n khi y&ecirc;u thường thể hiện t&iacute;nh c&aacute;ch đa sầu đa cảm của m&igrave;nh. Sau khi kết h&ocirc;n, họ cũng trở n&ecirc;n trầm tĩnh v&agrave; s&acirc;u lắng hơn nhưng ch&iacute;nh đ&acirc;y lại l&agrave; đặc điểm gi&uacute;p họ thu h&uacute;t sự ch&uacute; &yacute; của những người kh&aacute;c giới nhiều.</p>\r\n<p>V&igrave; rất c&oacute; l&ograve;ng tự trọng n&ecirc;n nam giới tuổi Th&igrave;n kh&ocirc;ng chỉ sợ bị tổn thương m&agrave; c&ograve;n sợ m&igrave;nh cũng l&agrave;m tổn thương người kh&aacute;c. V&igrave; thế, họ sẽ rất t&ocirc;n trọng, y&ecirc;u thương người y&ecirc;u của m&igrave;nh. Họ cũng rất hiểu v&agrave; biết th&ocirc;ng cảm vối t&acirc;m trạng của phụ nữ n&ecirc;n lại c&agrave;ng hấp dẫn người kh&aacute;c phải nhiều hơn nữa.</p>\r\n<p>Trong cuộc sống h&agrave;ng ng&agrave;y, nữ giới tuổi Th&igrave;n thường kh&aacute; nghi&ecirc;m t&uacute;c, &ocirc;n h&ograve;a. Những người n&agrave;y n&ecirc;n thể hiện sự nữ t&iacute;nh, mềm yếu nhiều hơn nữa để cho đối phương biết rằng họ cũng cần được gi&uacute;p đỡ, nhất l&agrave; với những người bạn trai th&acirc;n thiết. H&atilde;y để cho những người đ&agrave;n &ocirc;ng xung quanh bạn biết rằng b&ecirc;n trong vẻ cứng cỏi, nghi&ecirc;m t&uacute;c của bạn l&agrave; một t&acirc;m hồn v&agrave; tr&aacute;i tim dịu d&agrave;ng, l&atilde;ng mạn. L&agrave;m như vậy, họ sẽ c&agrave;ng y&ecirc;u qu&yacute; bạn hơn nữa.</p>\r\n<p>Nữ giới tuổi Th&igrave;n rất hợp với kiểu t&oacute;c uốn quăn th&agrave;nh từng lọn, cho d&ugrave; l&agrave; t&oacute;c d&agrave;i hay t&oacute;c ngắn th&igrave; uốn quăn sẽ l&agrave;m họ tr&ocirc;ng hấp dẫn v&agrave; xinh đẹp hơn. Họ cũng ph&ugrave; hợp để mặc những bộ quần &aacute;o với đường may t&aacute;o bạo, gợi cảm v&agrave; bắt mắt, chất vải mềm mại v&agrave; c&oacute; hoa văn nổi bật. Những m&agrave;u sắc cơ bản như m&agrave;u v&agrave;ng v&agrave; m&agrave;u đỏ c&oacute; thế khiến cho vẻ đẹp của họ c&agrave;ng th&ecirc;m rực rỡ, thu h&uacute;t được sự ch&uacute; &yacute; của rất nhiều người.</p>\r\n<h3>4. Tử vi tuổi Th&igrave;n năm 2016 về vận đ&agrave;o hoa</h3>\r\n<p>Người tuổi Th&igrave;n thường c&oacute; số đ&agrave;o hoa rất tốt, thường ph&aacute;t sau năm 26 tuổi nhất l&agrave; với nam giới.</p>\r\n<p>Nữ giới tuổi Th&igrave;n thường rất biết tiết chế t&igrave;nh cảm trong khi y&ecirc;u v&agrave; cũng kh&ocirc;ng bao giờ xi&ecirc;u l&ograve;ng ngay sau c&aacute;i nh&igrave;n đầu ti&ecirc;n, kể cả khi đối tượng l&agrave; một người ho&agrave;n mỹ. Ch&iacute;nh đặc điểm n&agrave;y đ&atilde; khiến cho nữ giới tuổi Th&igrave;n mất đi kh&aacute; nhiều ưu thế trong t&igrave;nh y&ecirc;u.</p>\r\n<p>Theo phong thủy, một số đồ vật sau đ&acirc;y c&oacute; thể mang lại may mắn v&agrave; t&igrave;nh y&ecirc;u cho người tuổi Th&igrave;n:</p>\r\n<ul>\r\n<li>Hoa may mắn: Hoa Tuyết th&aacute;ng 6</li>\r\n<li>Quả may mắn: Quả d&acirc;u t&acirc;y</li>\r\n<li>Đ&aacute; qu&yacute; may mắn: Hồng ngọc (đ&aacute; ru-bi)</li>\r\n</ul>\r\n<h3>5. Phương ph&aacute;p tăng vận t&igrave;nh duy&ecirc;n cho tuổi Th&igrave;n trong năm B&iacute;nh Th&acirc;n 2016</h3>\r\n<p>Người tuổi Th&igrave;n n&ecirc;n ăn nhiều nho để bổ huyết, bổ kh&iacute;; ăn nhiều mật ong để giữ g&igrave;n sắc đẹp v&agrave; k&eacute;o d&agrave;i tuổi thanh xu&acirc;n. Ngo&agrave;i ra, muốn đường t&igrave;nh duy&ecirc;n được ổn định v&agrave; mạnh mẽ hơn, người tuổi Th&igrave;n cũng n&ecirc;n đặt ở g&oacute;c nh&agrave; gần cửa ra v&agrave;o nhất một ngọn đ&egrave;n m&agrave;u v&agrave;ng ấm &aacute;p v&agrave; chỉ tắt đi những l&uacute;c ra ngo&agrave;i hoặc khi đi ngủ. L&agrave;m như vậy, đường t&igrave;nh duy&ecirc;n của người tuổi Th&igrave;n sẽ dần ổn định v&agrave; mạnh mẽ hơn.</p>\r\n<p>Người tuổi Th&igrave;n cũng n&ecirc;n cố gắng cười nhiều hơn. Bản t&iacute;nh l&atilde;ng mạn, ng&acirc;y thơ của họ đ&atilde; l&agrave; qu&aacute; đủ để thu h&uacute;t sự ch&uacute; &yacute; của người kh&aacute;c. Nếu c&oacute; th&ecirc;m một ch&uacute;t nước hoa nhẹ nh&agrave;ng th&igrave; vẻ đẹp ấy quả thực sẽ l&agrave; ho&agrave;n hảo.</p>\r\n<h2>II. Một v&agrave;i n&eacute;t chung của tuổi Th&igrave;n</h2>\r\n<h3>6. Tổng quan về tuổi Th&igrave;n</h3>\r\n<p>Rồng tượng trưng cho sự th&agrave;nh c&ocirc;ng. Từ khi mới sinh ra, người tuổi Th&igrave;n đ&atilde; gặp nhiều may mắn, c&oacute; được l&yacute; tưởng cao cả. Quan niệm nhiều khi cố chấp nhưng th&ocirc;ng minh. Đ&ograve;i hỏi sự ho&agrave;n hảo đối với mọi việc, rất cầu to&agrave;n. Th&iacute;ch mạo hiểm v&agrave; tr&agrave;n đầy nhiệt huyết cũng như sức sống m&atilde;nh liệt. Tuy c&oacute; một số đặc t&iacute;nh khiến cho người kh&aacute;c cảm thấy kh&oacute; chịu, nhưng nh&igrave;n chung những người tuổi Th&igrave;n đều rất c&oacute; duy&ecirc;n. Sau khi trưởng th&agrave;nh, họ vẫn lu&ocirc;n nhớ về tuổi thơ, v&agrave; theo đuổi cuộc sống l&atilde;ng mạn. Người tuổi Th&igrave;n cực k&igrave; vui vẻ, thuận lợi l&uacute;c về gi&agrave;, ch&iacute;nh l&agrave; "muốn gi&oacute; được gi&oacute;, mu&ocirc;n mưa được mưa".</p>\r\n<h3>7. T&iacute;nh c&aacute;ch của người tuổi Th&igrave;n với c&ocirc;ng việc</h3>\r\n<p>Trong c&aacute;c truyện truyền thuyết, thần thoại, nh&acirc;n vật rồng to lớn, oai phong thường để lại cho người đọc rất nhiều suy tưởng. Phẩm chất thần kỳ đ&oacute; cũng xuất hiện v&agrave; được thể hiện kh&aacute; r&otilde; n&eacute;t ở người tuổi Th&igrave;n.</p>\r\n<p>Họ đều rất khoan dung, độ lượng, lu&ocirc;n tr&agrave;n đầy sức sống v&agrave; sự lạc quan. Tuy c&oacute; m&ocirc;t số tật xấu l&agrave; lu&ocirc;n coi m&igrave;nh l&agrave; trung t&acirc;m, phiến diện, ph&aacute;n đo&aacute;n kh&ocirc;ng c&oacute; căn cứ, hay suy nghĩ ngược lại với người kh&aacute;c, đưa ra những y&ecirc;u cầu qu&aacute; cao,... nhưng họ vẫn được rất nhiều người ngưỡng mộ, s&ugrave;ng b&aacute;i. V&igrave; rất ki&ecirc;u ngạo v&agrave; thanh cao n&ecirc;n họ cũng x&aacute;c định được l&yacute; tưởng cho m&igrave;nh từ rất sớm; đồng thời, họ cũng y&ecirc;u cầu những người kh&aacute;c phải đạt được ti&ecirc;u chuẩn cao nhu vậy.</p>\r\n<p>V&igrave; t&iacute;nh c&aacute;ch qu&aacute; cứng rắn n&ecirc;n người tuổi Th&igrave;n c&oacute; khả năng b&ugrave;ng nổ rất lốn. Với những việc cần thiết, họ sẽ tự bắt tay v&agrave;o l&agrave;m m&agrave; sẽ kh&ocirc;ng thực hiện bằng c&aacute;ch vi&ecirc;t thư hoặc gọi điện thoại. Họ c&oacute; mặt ở đ&acirc;u l&agrave; sẽ thu h&uacute;t sự ch&uacute; &yacute; của mọi người ở đ&oacute; v&agrave; mọi việc sẽ được tiến h&agrave;nh đ&uacute;ng theo &yacute; họ. Họ c&oacute; thể k&iacute;ch th&iacute;ch được sự nhiệt t&igrave;nh của tất cả mọi người trong khi tiếp x&uacute;c. Tuy nhi&ecirc;n, họ kh&ocirc;ng cần đến bất kỳ một sự k&iacute;ch th&iacute;ch n&agrave;o từ ph&iacute;a người kh&aacute;c v&igrave; bản th&acirc;n họ đ&atilde; lu&ocirc;n tr&agrave;n đầy năng lượng.</p>\r\n<p>Những người sinh năm Th&igrave;n &nbsp;: 1916, 1928, 1940, 1952, 1964, 1976, 1988, 2000, 2012, 2024</p>\r\n</div>', '', '2016/04/5713c4653ec95_1460913253.jpg', '[]', 0, 10, 1, 0, 3, 1, '1.53.215.234', 1, 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', '2016-04-17 17:14:23', '2016-04-17 18:00:25'),
(5, NULL, NULL, 'Thiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại', '', 'thiet-ke-noi-that-can-ho-chung-cu-80m2-dep-hien-dai', 'n-a', 'Thiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại. Với phong cách thiết kế nội thất tinh tế – hiện đại, màu sắc trang nhã mà không kém phần ấm cúng. Bản thiết kế nội thất căn hộ 80m2 này thực sự đã mang đến cho gia chủ một không gian sống vừa tiện nghi, vừa sang trọng. Nếu bạn có một căn hộ với diện tích tương tự như căn hộ 80m2 này, thì đây là một công trình có phong cách thiết kế đáng để bạn lưu tâm, hãy cùng Thư viện nhà đẹp tham khảo:\r\n\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại\r\nKhông gian nội thất phòng khách được thiết kế nối liền với khu vực bếp và phòng ăn, sự thiết kế liên thông này mang lại cho căn hộ 80m2 nhiều ánh sáng và gió tự nhiên hơn, vừa đảm bảo mạch giao thông lưu chuyển được thuận tiện.\r\n\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp - Nội thất phòng khách\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp – Nội thất phòng khách\r\nPhòng khách rộng và thoáng nhờ tiếp giáp khung cửa lớn nối liền với khu vực ban công lộng gió. Bên cạnh là phòng làm việc nhỏ mà tiện nghi, giúp mang đến không gian tuyệt với cho những giờ làm việc căn thẳng.\r\n\r\nThiết kế nội thất căn hộ chung cư 80m2 - Phòng bếp\r\nThiết kế nội thất căn hộ chung cư 80m2 – Phòng bếp\r\nKhu vực bếp và bàn ăn của căn hộ chung cư 80m2 này được ưu ái về diện tích và tiện nghi. Những đồ nội thất được thiết kế với kiểu dáng hiện đại, đơn giản mà tinh tế sang trọng.\r\n\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp - Nội thất phòng khách\r\nThiết kế nội thất căn hộ chung cư 80m2 đẹp – Nội thất phòng khách\r\nĐiểm nhấn của không gian căn hộ là màu sắc tươi trẻ của những vật dụng nội thất hiện đại đầy cá tính…\r\n\r\nThiết kế nội thất căn hộ chung cư 80m2 - Phòng bếp\r\nThiết kế nội thất căn hộ chung cư 80m2 – Phòng bếp\r\nThiết kế nội thất căn hộ chung cư 80m2 - Phòng bếp\r\nThiết kế nội thất căn hộ chung cư 80m2 – Phòng bếp\r\nKhông gian ăn uống rộng rãi với đầy đủ tiện nghi và được thiết kế đẹp, giúp cho những bữa ăn sum họp gia đình trở nên ấm cúng và thoải mái hơn.\r\n\r\nThiết kế căn hộ 80m2 đẹp\r\nThiết kế căn hộ 80m2 đẹp\r\nThiết kế căn hộ 80m2 đẹp\r\nThiết kế căn hộ 80m2 đẹp\r\nPhòng làm việc nhỏ nhưng được thiết kế đơn giản và gọn gàng. Để tiết kiệm diện tích và tăng thêm không gian, window-seat được sử dụng, vừa là nơi ngồi thư giãn ngắm thành phố mỗi sáng chiều, vừa là nơi lưu trữ tuyệt vời.\r\n\r\nPhòng ngủ master\r\nPhòng ngủ master\r\nPhòng ngủ master\r\nPhòng ngủ master\r\nPhòng ngủ master\r\nPhòng ngủ master\r\nPhòng ngủ Master được thiết kế với chung một tinh thần của toàn bộ căn hộ chung cư 80m2 này. Màu sắc chủ đạo là màu trắng và màu nâu của gỗ. Mang lại cho chủ nhân một không gian nghỉ ngơi đúng nghĩa với đầy đủ tiện nghi.\r\n\r\nKhông gian phòng ngủ cho con được trang trí với màu sắc tươi trẻ phù hợp với lứa tuổi, mang đậm sắc thái của lứa tuổi, mang lại một không gian ưa nhìn và khoa học.', '', '<p><strong>Thiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại</strong>. Với phong c&aacute;ch thiết kế nội thất tinh tế &ndash; hiện đại, m&agrave;u sắc trang nh&atilde; m&agrave; kh&ocirc;ng k&eacute;m phần ấm c&uacute;ng. Bản <em><a href="http://thuviennhadep.net/noi-that-dep/thiet-ke-noi-that-can-ho-chung-cu-80m2-dep-hien-dai/" target="_blank">thiết kế nội thất căn hộ 80m2</a></em> n&agrave;y thực sự đ&atilde; mang đến cho gia chủ một kh&ocirc;ng gian sống vừa tiện nghi, vừa sang trọng. Nếu bạn c&oacute; một căn hộ với diện t&iacute;ch tương tự nhưcăn hộ 80m2 n&agrave;y, th&igrave; đ&acirc;y l&agrave; một c&ocirc;ng tr&igrave;nh c&oacute; phong c&aacute;ch thiết kế đ&aacute;ng để bạn lưu t&acirc;m, h&atilde;y c&ugrave;ng Thư viện nh&agrave; đẹp tham khảo:</p>\r\n<div id="attachment_4000" class="wp-caption aligncenter"><img class="wp-image-4000 size-full" title="Thiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-5.jpg" alt="Thiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại" width="834" height="346" />\r\n<p class="wp-caption-text">Thiết kế nội thất căn hộ chung cư 80m2 đẹp hiện đại</p>\r\n</div>\r\n<p>Kh&ocirc;ng gian nội thất ph&ograve;ng kh&aacute;ch được thiết kế nối liền với khu vực bếp v&agrave; ph&ograve;ng ăn, sự thiết kế li&ecirc;n th&ocirc;ng n&agrave;y mang lại cho <a href="http://thuviennhadep.net/noi-that-dep/thiet-ke-noi-that-can-ho-chung-cu-80m2-dep-hien-dai/" target="_blank">căn hộ 80m2</a> nhiều &aacute;nh s&aacute;ng v&agrave; gi&oacute; tự nhi&ecirc;n hơn, vừa đảm bảo mạch giao th&ocirc;ng lưu chuyển được thuận tiện.</p>\r\n<div id="attachment_4001" class="wp-caption aligncenter"><img class="size-full wp-image-4001" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-2.jpg" alt="Thiết kế nội thất căn hộ chung cư 80m2 đẹp" width="900" height="314" />\r\n<p class="wp-caption-text"><a href="http://thuviennhadep.net/noi-that-dep/thiet-ke-noi-that-can-ho-chung-cu-80m2-dep-hien-dai/" target="_blank">Thiết kế nội thất căn hộ chung cư 80m2 đẹp</a></p>\r\n</div>\r\n<div id="attachment_4002" class="wp-caption aligncenter"><img class="size-full wp-image-4002" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-4.jpg" alt="Thiết kế nội thất căn hộ chung cư 80m2 đẹp - Nội thất ph&ograve;ng kh&aacute;ch" width="750" height="407" />\r\n<p class="wp-caption-text">Thiết kế nội thất căn hộ chung cư 80m2 đẹp &ndash; Nội thất ph&ograve;ng kh&aacute;ch</p>\r\n</div>\r\n<p>Ph&ograve;ng kh&aacute;ch rộng v&agrave; tho&aacute;ng nhờ tiếp gi&aacute;p khung cửa lớn nối liền với khu vực ban c&ocirc;ng lộng gi&oacute;. B&ecirc;n cạnh l&agrave; ph&ograve;ng l&agrave;m việc nhỏ m&agrave; tiện nghi, gi&uacute;p mang đến kh&ocirc;ng gian tuyệt với cho những giờ l&agrave;m việc căn thẳng.</p>\r\n<div id="attachment_4003" class="wp-caption aligncenter"><img class="size-full wp-image-4003" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-6.jpg" alt="Thiết kế nội thất căn hộ chung cư 80m2 - Ph&ograve;ng bếp" width="650" height="425" />\r\n<p class="wp-caption-text">Thiết kế nội thất căn hộ chung cư 80m2 &ndash; Ph&ograve;ng bếp</p>\r\n</div>\r\n<p>cc<img class="size-full wp-image-4004" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-7.jpg" alt="Thiết kế nội thất căn hộ chung cư 80m2 đẹp - Nội thất ph&ograve;ng kh&aacute;ch" width="650" height="422" /></p>\r\n<div id="attachment_4004" class="wp-caption aligncenter">\r\n<p class="wp-caption-text">Thiết kế nội thất căn hộ chung cư 80m2 đẹp &ndash; Nội thất ph&ograve;ng kh&aacute;ch</p>\r\n</div>\r\n<p>Điểm nhấn của kh&ocirc;ng gian căn hộ l&agrave; m&agrave;u sắc tươi trẻ của những vật dụng nội thất hiện đại đầy c&aacute; t&iacute;nh&hellip;</p>\r\n<div id="attachment_4005" class="wp-caption aligncenter"><img class="size-full wp-image-4005" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-8.jpg" alt="Thiết kế nội thất căn hộ chung cư 80m2 - Ph&ograve;ng bếp" width="828" height="356" />\r\n<p class="wp-caption-text">Thiết kế nội thất căn hộ chung cư 80m2 &ndash; Ph&ograve;ng bếp</p>\r\n</div>\r\n<div id="attachment_4006" class="wp-caption aligncenter"><img class="size-full wp-image-4006" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-9.jpg" alt="Thiết kế nội thất căn hộ chung cư 80m2 - Ph&ograve;ng bếp" width="650" height="446" />\r\n<p class="wp-caption-text">Thiết kế nội thất căn hộ chung cư 80m2 &ndash; Ph&ograve;ng bếp</p>\r\n</div>\r\n<p>Kh&ocirc;ng gian ăn uống rộng r&atilde;i với đầy đủ tiện nghi v&agrave; được thiết kế đẹp, gi&uacute;p cho những bữa ăn sum họp gia đ&igrave;nh trở n&ecirc;n ấm c&uacute;ng v&agrave; thoải m&aacute;i hơn.</p>\r\n<div id="attachment_4007" class="wp-caption aligncenter"><img class="size-full wp-image-4007" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-1.jpg" alt="Thiết kế căn hộ 80m2 đẹp" width="603" height="762" />\r\n<p class="wp-caption-text">Thiết kế căn hộ 80m2 đẹp</p>\r\n</div>\r\n<div id="attachment_4008" class="wp-caption aligncenter"><img class="size-full wp-image-4008" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-17.jpg" alt="Thiết kế căn hộ 80m2 đẹp" width="603" height="753" />\r\n<p class="wp-caption-text">Thiết kế căn hộ 80m2 đẹp</p>\r\n</div>\r\n<p>Ph&ograve;ng l&agrave;m việc nhỏ nhưng được thiết kế đơn giản v&agrave; gọn g&agrave;ng. Để tiết kiệm diện t&iacute;ch v&agrave; tăng th&ecirc;m kh&ocirc;ng gian, window-seat được sử dụng, vừa l&agrave; nơi ngồi thư gi&atilde;n ngắm th&agrave;nh phố mỗi s&aacute;ng chiều, vừa l&agrave; nơi lưu trữ tuyệt vời.</p>\r\n<div id="attachment_4009" class="wp-caption aligncenter"><img class="size-full wp-image-4009" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-10.jpg" alt="Ph&ograve;ng ngủ master" width="650" height="448" />\r\n<p class="wp-caption-text">Ph&ograve;ng ngủ master</p>\r\n</div>\r\n<div id="attachment_4010" class="wp-caption aligncenter"><img class="size-full wp-image-4010" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-11.jpg" alt="Ph&ograve;ng ngủ master" width="650" height="440" />\r\n<p class="wp-caption-text">Ph&ograve;ng ngủ master</p>\r\n</div>\r\n<div id="attachment_4011" class="wp-caption aligncenter"><img class="size-full wp-image-4011" src="http://thuviennhadep.net/wp-content/uploads/Thiet-ke-noi-that-can-ho-chung-cu-80m2-12.jpg" alt="Ph&ograve;ng ngủ master" width="650" height="301" />\r\n<p class="wp-caption-text">Ph&ograve;ng ngủ master</p>\r\n</div>\r\n<p>Ph&ograve;ng ngủ Master được thiết kế với chung một tinh thần của to&agrave;n bộ căn hộ chung cư 80m2 n&agrave;y. M&agrave;u sắc chủ đạo l&agrave; m&agrave;u trắng v&agrave; m&agrave;u n&acirc;u của gỗ. Mang lại cho chủ nh&acirc;n một kh&ocirc;ng gian nghỉ ngơi đ&uacute;ng nghĩa với đầy đủ tiện nghi.</p>\r\n<p>Kh&ocirc;ng gian ph&ograve;ng&nbsp;ngủ cho con được trang tr&iacute; với m&agrave;u sắc tươi trẻ ph&ugrave; hợp với lứa tuổi, mang đậm sắc th&aacute;i của lứa tuổi, mang lại một kh&ocirc;ng gian ưa nh&igrave;n v&agrave; khoa học.</p>', '', 'http://cdn.jinn.vn/asset/frontend/upload/stories/2016/04/571126548c027_1460741716.png', '[]', 0, 1, 1, 0, 1, 1, '1.53.215.234', 1, 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', '2016-04-17 17:44:18', '2016-04-17 17:44:52');
