(19, 2, 'A3', NULL, 'a3', NULL, 'ARCADIA', NULL, '["2016\\/01\\/20\\/569f54f2027da_1453282546.jpg"]', 'The Arcadia A3 là tòa căn hộ cao nhất trong khu The Arcadia, tiếp giáp sân chơi tennis, bể bơi trung tâm, sân chơi trẻ em, vườn xuân, và đường chạy bộ… Phóng tầm nhìn từ tòa A3, bạn sẽ chiêm ngưỡng góc nhìn xanh tuyệt đẹp trải dọc khu đô thị.\r\nSố tầng: 39 tầng.\r\nLoại căn hộ: Căn hộ 1 tầng và Căn hộ thông tầng (duplex)\r\nSố căn hộ: 741 căn hộ.\r\nDiện tích căn hộ: Từ 54m2 đến 146,8m2.\r\nSố phòng ngủ: Từ 1 đến 4 phòng ngủ.', NULL, '', NULL, '', NULL, '', 39, '', 0, 1, '', '', 49, 1, 1, 26, 26, '2016-01-05 04:44:32', '2016-01-20 09:35:50', NULL, NULL, NULL, NULL, NULL, NULL),
