(28, 1, 'Park Paroma', 'Park Paroma', 'park-paroma', 'park-paroma', 'P4', NULL, '[]', 'Park Paroma (Park 4) là toà tháp đẹp nhất của siêu dự án Vinhomes Central\r\nPark (Tân Cảng). Với vị trí nằm sát công viên ven sông rộng 14ha và\r\ntầm nhìn panorama tuyệt đẹp hướng ra sông Sài Gòn thơ mộng, xanh\r\nmát, các căn hộ Park Paroma được thiết kế hiện đại và sang trọng, có khe\r\nsáng và mặt thoáng để đón gió, ánh sáng tự nhiên.\r\nĐặc biệt, Park Paroma được trang bị 8 thang máy hiện đại cùng mật độ\r\ncư dân thấp nhất (chỉ 10 căn hộ/ tầng) sẽ mang tới một cuộc sống đẳng\r\ncấp và riêng tư, yên tĩnh.', '', '', '', '', '', '{"1":"Tầng trệt","2":"Tầng 2","3":"Tầng 3","4":"Tầng 4","5":"Tầng 5","6":"Tầng 6","7":"Tầng 7","8":"Tầng 8","9":"Tầng 9","10":"Tầng 10","11":"Tầng 11","12":"Tầng 12","13":"Tầng 12A","14":"Tầng 12B","15":"Tầng 15","16":"Tầng 16","17":"Tầng 17","18":"Tầng 18","19":"Tầng 19","20":"Tầng 20","21":"Tầng 21","22":"Tầng 22","23":"Tầng 23","24":"Tầng 24","25":"Tầng 25","26":"Tầng 26","27":"Tầng 27","28":"Tầng 28","29":"Tầng 29","30":"Tầng 30","31":"Tầng 31","32":"Tầng 32","33":"Tầng 33","34":"Tầng 34","35":"Tầng 35","36":"Tầng 36","37":"Tầng 37","38":"Tầng 38","39":"Tầng 39","40":"Tầng 40","41":"Tầng 41","42":"Tầng 42","43":"Tầng 43"}', 43, '', 187, 13, '', '', 98, 1, 10, 28, 28, '2016-02-29 08:29:11', '2016-04-26 06:03:25', NULL, NULL, NULL, NULL, NULL, NULL),
(29, 11, 'Aqua 1', 'Aqua 1', 'aqua-1', 'aqua-1', 'A1', NULL, '[]', '', '', '', '', 'I. Chính sách chung:\r\n1. Thời gian áp dụng: 10/04/2016\r\n2. Đối tượng áp dụng: Khách hàng đăng ký căn hộ Vinhomes Golden River từ ngày 10/04/2016\r\nII. Chương trình khuyến mãi dành cho khách hàng đăng ký căn hộ Vinhomes Golden River từ ngày 10/04/2016 cho đến khi có thông báo khác của CĐT:\r\nKhách hàng đăng ký nguyện vọng mua căn hooj được tặng gói dịch vụ Vinmec: gồm 2 Voucher VIP Adult Vinmec dành cho 2 người lớn và 2 Voucher Premium Child dành cho 2 trẻ em có giá trị trong 12 tháng.\r\n(*) Lưu ý: Điều kiện và thời hạn sử dụng sẽ theo quy định của nhà cung cấp\r\nIII. Chương trình bốc thăm trúng thưởng: \r\nKhách hàng đăng ký nguyện vọng mua căn hộ Vinhomes Golden River sẽ được tặng 1 phiếu bốc thăm/ căn hộ để tham gia Chương trình Bốc thăm trúng thưởng của CĐT, cơ cấu giải thưởng:\r\n-5 xe Mercedes-Benz S500\r\nIV. Các gói sản phẩm/dịch vụ có thể lựa chọn:\r\n1. Gói 10 năm nước nóng: \r\n-Ưu đãi phí nước nóng cố định ở mức 30.000 đồng/m3 ( chưa gồm VAT) trong vòng 10 năm không tăng giá\r\n-Đơn giá bán: 20.000.000 đồng/gói\r\n2. Gói dịch vụ Vinmec: \r\n-Gói VIP Vinmec Family dành cho 4 người ( 2 người lớn, 2 trẻ em) và có giá trị trong vòng 12 tháng ( dịch vụ chăm sóc sức khỏe không chịu VAT)\r\n-Đơn giá bán: 30.000.000 đồng/gói\r\n3. Gói dịch vụ Vinschool:\r\n- Gói dịch vụ giáo dục tại Trường Phổ thông liên cấp Vinschool gồm 100% tiền học phí và tiền ăn trong vòng 1 năm\r\n- Đơn giá bán: 49.600.000 đồng/gói\r\n4. Gói dịch vụ nghỉ dưỡng Vinpearl:\r\n- Gồm 6 đêm nghỉ dưỡng tại Vinpearl Resort Phú Quốc/Nha Trang ( phòng Duluxe Garden view) có giá trị trong vòng 12 tháng\r\n- Đơn giá: 30.500.000 đồng/gói\r\nV. Tiến độ thanh toán:\r\n(*) Lần 2-HĐVV: Đã bao gồm tiền thanh toán lần 1 ( nếu có) – Thnah toán trong vòng 5 ngày kể từ ngày ký HĐVV\r\nHĐVV ( giá trị căn chưa VAT và KPBT)\r\n-Lần 1: 200.000.000 đồng\r\n-Lần 2: 5% giá bán căn hộ - Trong vòng 5 ngày kể từ ngày ký lần 1\r\n-Lần 3: 10% giá bán căn hộ - 26/05/2016\r\nHĐMB ( giá trị căn gồm VAT và KPBT)\r\n-Lần 1: 30% giá bán căn hộ - Khi ký HĐMB, đã gồm tiền tại HĐVV ( dự kiến tháng 6/2016)\r\n-Lần 2: 10% giá bán căn hộ - 26/08/2016\r\n-Lần 3: 10% - 26/10/2016\r\n-Lần 4: 10% - 26/12/2016', '', '', 50, '', 16, 14, '', '', 4, 3, 28, 28, 28, '2016-04-25 08:43:32', '2016-04-25 09:33:16', NULL, NULL, NULL, NULL, NULL, NULL),
