 3: 10% giá bán căn hộ - 26/05/2016\r\nHĐMB ( giá trị căn gồm VAT và KPBT)\r\n-Lần 1: 30% giá bán căn hộ - Khi ký HĐMB, đã gồm tiền tại HĐVV ( dự kiến tháng 6/2016)\r\n-Lần 2: 10% giá bán căn hộ - 26/08/2016\r\n-Lần 3: 10% - 26/10/2016\r\n-Lần 4: 10% - 26/12/2016', '', '', 50, '', 16, 14, '', '', 19, 1, 28, 28, 28, '2016-04-26 07:11:21', '2016-07-13 15:15:24', NULL, NULL, NULL, NULL, NULL, NULL),
