(12, 'Vinpearl Long Beach Villas', 'Vinpearl Long Beach Villas', 'vinpearl-long-beach-villas', 'vinpearl-long-beach-villas', 'Nơi đây sở hữu vị trí " vàng" đắc địa, tiện ích dịch  vụ đa dạng và đẳng cấp, hình thức sở hữu lâu dài, lợi ích cam kết cho thuê, đầu tư an toàn tuyệt đối, lợi thế  của các tiện ích vượt trội đã hoàn thành và quy hoạch đồng bộ và đưa vào sử dụng của các khu khách sạn Vinpearl, Chủ đầu tư uy tín, trao đổi kỳ nghỉ trên toàn bộ hệ thống Vinpearl hiện tại và tương lai trên các địa điểm vàng và đắc địa bậc nhất Việt Nam và trên thế giới. Tọa lạc tại Bãi Dài- 1 trong những bãi biển đẹp và hoang sơ nhất vịnh Nha Trang. dự án này được kết nối giao thông thuận tiện khi chỉ cách sân bay quốc tế Cam Ranh 5 phút đi xe. Không những vậy tại đây còn sở hữu tầm nhìn rộng mở hướng ra biển xanh hay bao trọn toàn bộ cảnh quan với diện tích hồ rộng lớn.Dự án này dược tư vấn và qui hoạch cảnh quan và thiết kế kiến trúc bởi những đơn vị hàng đầu thế giới như EDSA, FSC (Hoa Kỳ), được trang bị hệ thống tiện ích 5 sao như nhà hàng sang trọng, khu tập gym, hồ bơi,.... Đặc biệt chủ đầu tư cam kết sinh lời tối thiểu 10%/ năm trong 10 năm và cam kết chia sẻ trọn đời 85% lợi nhuận từ việc cho thuê lại. Áp dụng chính sách đồng sở hữu và chính sách hỗ trợ vay vốn ngân hàng Techcombank đồng thời tặng thêm 15 đêm nghỉ/năm tại biệt thự sở hữu hoặc trao đổi kì nghỉ tại tất cả các khu nghỉ dưỡng thuộc hệ thống nghỉ dưỡng Vinpearl.', NULL, 'Lô D6B2 và D7A1 thuộc khu 2, khu du lịch Bắc Bán Đảo Cam Ranh, huyện Cam Lâm, Khánh Hòa', 'Lô D6B2 và D7A1 thuộc khu 2, khu du lịch Bắc Bán Đảo Cam Ranh, huyện Cam Lâm, Khánh Hòa', NULL, NULL, 380, NULL, '2016/04/57203024b1936_1461727268.jpg', NULL, NULL, '["2016\\/04\\/572032a989679_1461727913.png"]', 0, 200, 0, 0, 0, 11, '261.948', NULL, 'Vinpearl Long Beach Villas', 'Vinpearl Long Beach Villas', NULL, NULL, NULL, NULL, 25, 1, 28, 1, NULL, '2016-04-25 06:40:36', '2016-04-27 14:32:01'),
(13, 'Condotel Empire Condotel', 'Condotel Empire Condotel', 'condotel-empire-condotel', NULL, 'Dự án tọa lạc tại vị trí đẹp, đắc địa với view hướng biển, thoáng đãng tầm nhìn rộng mở. Dự án nằm ngay trung tâm thành phố Nha Trang, cách ga xe lửa Nha Trang 5 đi ô tô và 40 phút lái xe từ sân bay quốc tế Cam Ranh.Dự án này là sự kết hợp hoàn hảo giữa căn hộ cao cấp và tiện nghi khách sạn tiêu chuẩn 5 sao- sản phẩm bất động sản nghỉ dưỡng mới ra mắt của Tập đoàn Vingroup.', NULL, '44-46 Lê Thánh Tôn, Nha Trang', '44-46 Le Thanh Ton, Nha Trang', NULL, NULL, 380, NULL, '2016/04/572029213d340_1461725473.jpg', NULL, NULL, '["2016\\/04\\/57202adb38ff1_1461725915.jpg"]', 0, 924, 0, 0, 0, 14, '6524', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 29, 1, 28, 28, NULL, '2016-04-25 06:55:40', '2016-04-27 02:58:43'),
(14, 'Vinpearl Paradise Villas', 'Vinpearl Paradise Villas', 'vinpearl-paradise-villas', NULL, 'Vinpearl Paradise Villas tọa lạc tại Bãi Dài, nằm phía Tây Bắc của Đảo Phú Quốc – 1 trong 10 bãi biển hoang sơ và đẹp nhất thế giới do BBC bình chọn.Bãi biển duy nhất có cát vàng tự nhiên và làn nước biển trong xanh như ngọc bích.So với Bãi Khem ở phía Nam hình cánh cung, Bãi Dài thẳng hơn, song êm do Vịnh bao bọc.Nơi đây rất thuận tiện cho việc di chuyển tới các điểm thăm quan du lịch trên đảo như Vườn Quốc gia Phú Quốc, làng chài Hàm Ninh,…Và đây cũng là nơi lưu trữ nét đẹp hoang sơ nguyên thủy trên đảo Phú Quốc.\nDự án này được gọi là điểm đến quốc tế vì nơi hội tụ đầy đủ các tiện ích như  sân bay quốc tế, cảng tàu du lịch quốc tế (Vinpearl đã khởi công xây dựng vào ngày 29/04/2015 trị giá 1600 tỷ sẽ hoàn thành vào năm 2017), Casino Quốc tế ( có vị trí sát cạnh Vinpearl Phú Quốc trị giá 4 tỷ USD), Bệnh viện Vinmec Phú Quốc vừa khai trương vào ngày 19/06/2015, vốn đầu tư 1000 tỷ, quy mô 1900m2), vườn thú Vinpearl safari rộng 500ha, sẽ khánh thành giai đoạn 1 quy mô 180ha vào 24/12/2015).\n Hiện nay, Sân bay Quốc tế Phú quốc các đường bay mới đã được đưa vào hoạt động (Phú Quốc – Singapore và Phú Quốc – Siem Reap) với 15 chuyến bay thẳng nội địa và quốc tế mỗi ngày. Trong đó có 7 chuyến bay từ Hồ Chí Minh, 1 chuyến  từ Cần Thơ, 1 chuyến từ Singapore, 1 chuyến từ Sieam Cambodia và 1 chuyến từ Nga.Dự kiến trong năm 2015 sẽ mở các chuyến thẳng từ Đà Nẵng, Nha Trang.\nCông viên bảo tồn động vật Vinpearl Safari với quy mô 500ha lớn nhất Việt Nam, vốn đầu tư 3300 tỷ. Mô hình Vườn thú mở bao gồm Vườn thú ngày và vườn thú đêm. 9 khu vực chủ đề phong phú mang cảnh quan và kiến trúc đặc trưng các khu vực trên thế giới, chia thành nhiều giai đoạn phát triển. Giai đoạn 1: diện tích 180ha, phát triển 2 khu chủ đề: Châu Phi và Ấn Độ, là nơi chăm sóc và nuôi dưỡng phát triển khoảng 130 loài động vật với 2000 cá thể, 400 loài thực vật bản địa và nhập ngoại. Giai đoạn 1 khai trương vào ngày 24/12/2015.\nDự án có 8 ưu điểm vượt trội về qui hoạch tổng thể như sau:\n• Các căn biệt thự đều có view hồ, khoảng cách hồ rộng nhất trong các dự án chỗ rộng nhất trong các dự án chỗ rộng nhất lên tới 300m\n• Quy hoạch vượt trội với các căn dãy đằng sau có độ cao từ 3.5 đến 14m với view nhìn ra hồ tuyệt đẹp \n• Lần đầu tiên có thiết kế căn biệt thự 3PN, 2 tầng\n• Lần đầu tiên thiết kế đập tràn\n• Lần đầu tiên có hệ thống công viên cây xanh với diện tích 15ha bao gồm quảng trường và công trình tiện ích, nằm sát cạnh dự án.\n• Diện tích hồ lớn nhất trong dự án, lien thông giữa các căn biệt thự làm điều hòa không khí, tốt về mặt phong thủy mang đến vận hội tốt đẹp cho các chủ nhân sở hữu biệt thự\n• Thiết kế nội thất tân cổ điển sang trọng\n• Dự án còn lại duy nhất của Vinpearl Phú Quốc trên Bãi Dài.', NULL, NULL, NULL, NULL, NULL, 390, NULL, '2016/04/57202c8ebff83_1461726350.jpg', NULL, NULL, '["2016\\/04\\/57202efb87405_1461726971.jpg"]', 0, 332, 0, 0, 0, 2, '39.5', '15', NULL, NULL, NULL, NULL, NULL, NULL, 28, 1, 28, 28, NULL, '2016-04-25 07:10:30', '2016-04-27 03:16:23'),
